import React from 'react';

export default function VehiclesCard(props) {
  const { title, price, description, year, color, id, deleteBtn, editBtn, favoriteBtn } = props;
  return (
    <div id={ id }>
      <div>
        <button onClick={ editBtn }>edit</button>
        <button onClick={ deleteBtn }>delete</button>
        <input type="checkbox" onClick={ favoriteBtn }>favorite</input>
      </div>
      <div>
        <h1>{ title }</h1>
        <h2>{ price }</h2>
        <p>{ description }</p>
        <p>{ year }</p>
        <p>{ color }</p>
      </div>
    </div>
  )
}
